  "91ff22cfdfae4000a6d9": "Ang PCI DSS (Payment Card Industry Data Security Standard) ay ang global standard sa security ng data para sa industry ng payment card. Dinevelop ng mga major na credit card organization tulad ng Visa, MasterCard, at American Express, layunin ng PCI DSS na protektahan ang data ng cardholder at pigilan ang fraud, pag-hack, at mga security vulnerability sa credit card.\n\nAng PCI DSS ay binubuo ng 12 core security requirements na sumasaklaw sa security ng network, protection sa data, pag-manage sa vulnerability, access control, pag-monitor ng network, at mga patakaran sa security ng information. Ang lahat ng merchant at service provider na nagha-handle, nagso-store, o nagta-transmit ng credit card information ay dapat mag-comply sa mga standard na ito.\n\nAng {brandName} ay PCI-certified, na nagpapakita na ang data security measures nito ay nagko-comply sa internationally recognized na standards. Tinitiyak ng certification na ito ang epektibong protection sa credit card information at iba pang sensitive data ng mga customer laban sa mga breach at fraud.",
