  "99k7WVk3eymfiacNiM2JLv": "<span>Public Key:</span> Ang iyong <a href='{url}' target='_blank'>public key</a> ay katulad ng address ng wallet mo. Puwede mo itong i-share para makatanggap ng funds o gumamit ng decentralized applications (<a href='{dappsurl}' target='_blank'>dapps</a>). Generated ito mula sa private key, pero hindi nito mare-reveal o made-deduce ang iyong <a href='{url2}' target='_blank'>private key</a>.",
