  "9b49625b13694000aa6f": "Ang account security system ng {brandName} ay binubuo ng dalawang part: verification at risk control. Ang aming risk control protocol ay nagde-deploy ng mga anti-phishing strategy sa mga multiple na scenario tulad ng mga pag-log in, withdrawal, at pagbabago sa settings ng security. Ine-evaluate nito ang mga device, IP address, at nakaraang behavior ng user para ma-assess ang mga potential na risk. Kung may na-detect na risk, ii-initiate ang mga karagdagang step sa verification batay sa specific na scenario para mapanatiling safe ang mga account.",
