  "a3ad8ebe7d904000af8e": "Kapag nagki-create ang mga user ng API o ina-access ang page ng API management, puwede lang gumawa ng mga withdrawal mula sa IP address ng user at mga tinukoy na withdrawal address. Epektibo nitong nare-reduce ang risk ng security breach kung sakaling nag-leak o nawala ang API key.",
  "a4HWeqMA3NNtUsRPtDwQov": "Kung ang price ng {coin1} ay katumbas ng o mas mababa sa {protectPrice}, makakatanggap ka ng {num} {coin1}.",
