  "a775e0c384f34000a3a8": "Nagpapatupad ang {brandName} ng segregation ng permission para sa mga KPI ng user, kabilang ang mga general, spot trading, margin, at futures permission. Ang iba't ibang level ng permission ay nagko-correspond sa iba-ibang operation, na pumipigil sa mga cross-permission action. Para baguhin ang mga permission, dapat munang mag-log in ang mga user sa kanilang account, kaya natitiyak ang security ng funds nila.",
