  "asset.faq.answer.one": "Ginagamit ang Funding Account para sa mga crypto deposit, withdrawal, at purchase sa pamamagitan ng mga credit/debit card, at pati na rin sa margin lending. Ginagamit ang Trading Account para sa crypto trading. Ginagamit ang Margin Account para sa margin borrowing at trading. Ginagamit ang Futures Account para sa futures trading. Ginagamit ang Financial Account para sa staking at financial management, na may annual yield na hanggang 20%.",
