  "assets.por.audit.verify.content1": "Tandaan na magdudulot ng mga pagkakaiba sa assets ng iyong current account ang mga factor tulad ng oras ng snapshot at incorporated na account assets.",
  "assets.por.audit.verify.content2": "Pumasa sa verification. Safe na sino-store at pinoprotektahan ang asset ng isang user.<br/>\nDahil puwedeng mag-participate sa verification ang lahat, mapagkakatiwalaan ang total amount ng user assets sa platform.",
  "assets.por.audit.verify.content3": "Authentic at tamper-proof na on-chain assets.",
