  "assetsBack.cs.airCoin.applyDes": "Paki-review ang mga detalye ng iyong request. Kapag naaprubahan na, ino-notify ka namin tungkol sa applicable na service fee, na ide-deduct sa Funding Account mo para makumpleto ang proseso ng recovery ng asset. <br>Kung hindi mare-recover ang iyong mga asset, o kung ang dahilan ng pag-fail ng deposit ay hindi dulot ng error sa panig mo, walang mai-incur na fee. Kung sumasang-ayon ka sa terms na ito, i-click ang I-confirm at magpapatuloy kami sa iyong request.",
  "assetsBack.cs.airCoin.reason1": "<span>Kung hindi supported sa {brandName} ang blockchain network ng dineposit na cryptocurrency, o <span class='{style}'>kung na-unlist o na-delist sa {brandName} ang cryptocurrency na dineposit mo</span>, hindi maki-credit ang deposit.</span>",
  "assetsBack.cs.airCoin.reason2": "<span>Para sa safety ng iyong funds, <span class='{style}'>sa original na blockchain address lang namin puwedeng i-return ang deposit mo kapag naaprubahan na ito, at ibibigay ang TxID ng refund. Kung mayroon kang anumang espesyal na sitwasyon, makipag-ugnayan sa aming official na customer support sa support@kucoin.com.</span> Kung ibang platform ang source address ng deposit, pakikontak ang respective platform para sa susunod na ilang step kapag nakumpleto na namin ang refund sa aming panig.</span>",
