  "assetsBack.form.tips1": "Para sa safety ng funds mo, <span class='{style}'>maaari lang naming ibalik ang iyong na-deposit na funds sa source address nang walang anumang memo, tag, o message.</span> Kung pagmamay-ari ng isang platform ang source address ng deposit, kontakin ang platform na iyon para sa karagdagang suporta pagkatapos ibalik ng KuCoin ang iyong funds. Kapag may mga espesyal na pangyayari, kontakin kami sa support@kucoin.com.",
  "assetsBack.form.tips2": "Note: Para mapangalagaan ang iyong mga asset, maaari lang naming i-return ang na-recover na funds sa source address ng original deposit (ibig sabihin, pabalik sa address kung saan ipinadala ang mga ito sa blockchain). Para sa anumang espesyal na sitwasyon, makipag-ugnayan sa aming Customer Service sa support@kucoin.com. Kung ang return address ay isang hot wallet address na kabilang sa ibang platform, kakailanganin mong kontakin ang platform na iyon para sa karagdagang tulong kapag nakumpleto na ang refund sa aming panig.",
  "assetsBack.form.tooltip1": "Piliin ang na-deposit na coin mula sa drop-down menu. Kung hindi mo nakikita ang iyong coin, paki-enter ito nang manual.",
  "assetsBack.reason1": "Nakalimutang mag-specify o nag-specify ng maling Tag/Memo noong nag-deposit.",
  "assetsBack.reason1.confirmModelDes": "I-confirm na tama ang impormasyon sa application mo. Kapag naaprubahan na ang iyong application, ino-notify ka namin para bayaran ang mga corresponding fee. Pagkatapos makumpleto ang application mo, ibibigay namin sa iyo ang TxID ng ibinalik na deposit.",
  "assetsBack.reason1.des1": "Para sa ilang partikular na cryptocurrency tulad ng XLM, EOS, at XRP, kailangang maglagay ng tag o memo habang isinasagawa ang proseso ng pag-deposit. Kung pareho mong hindi na-enter nang tama ang address at tag, magfi-fail ang deposit.",
  "assetsBack.reason1.des2": "Para sa safety ng iyong funds, <span class='{style}'>maaari lang naming i-return ang na-deposit na funds sa source address nang walang anumang memo, tag, o message. Ipo-provide ang TxID ng na-return na funds.</span> Kung ang source address ng deposit ay kabilang sa ibang platform, kakailanganin mong kontakin sila para sa karagdagang suporta kapag nakumpleto na namin ang pag-return sa aming panig. Kung mayroon kang anumang espesyal na sitwasyon, makipag-ugnayan sa amin sa support@kucoin.com.",
