  "beginnerZone.rule.item1": "1. Magsisimula ang event sa {date} at magtatagal sa limitadong panahon.",
  "beginnerZone.rule.item2": "2. Mag-sign up para sa mystery box at manalo ng hanggang {num1} USDT. Mga bagong user lang na successful na nakapag-sign up sa {brandName} sa duration ng event ang eligible. Pagkatapos mag-sign up, magkakaroon ang mga user ng isang pagkakataong manalo ng mystery box na nagkakahalaga ng hanggang {num2} USDT.",
