  "beginnerZone.rule.item4": "4. Puwedeng mag-deposit o mag-buy ng crypto ang mga user sa pamamagitan ng Fast Trade, P2P, at third-party payments para makumpleto ang task. Hindi iko-consider ang Red Packets at Trial Funds.",
  "beginnerZone.rule.item5": "5. Kumpletuhin ang una mong trade at manalo ng hanggang {num1} USD. Mga user lang na hindi pa kailanman nag-trade sa {brandName} bago ang event ang eligible. Ang mga user na gumawa ng kanilang unang trade na nagkakahalaga ng {num2} USD o higit pa sa duration ng event ay magiging eligible sa lucky draw para manalo ng dalawang mystery box na nagkakahalaga ng hanggang {num3} USD. Para sa mga layunin ng event na ito, hindi ika-count ang trading volume na walang fee rate.",
  "beginnerZone.rule.item6": "6. Kabilang sa valid na trades ang futures trades, spot trades, purchases ng {brandName} Earn products, trades na ginawa ng trading bots, at margin trades. Ika-calculate ang values ayon sa amount ng transaction sa oras ng successful na placement ng order.",
