  "beginnerZone.rule.item9": "9. Maaaring kabilang sa rewards sa mystery boxes: Futures Deduction Coupons, Futures Trial Funds, Rate-Up Coupons, Fiat Deduction Coupons, Hot Coins, Trading Fee Rebate Coupons, Margin Bonuses, Interest-Free Coupons, at marami pang iba.",
  "beginnerZone.rule.other": "Mga Karagdagang Rule",
  "beginnerZone.rule.other.item1": "1. Dapat i-claim ang mga reward sa loob ng {num} (na) araw, kung hindi, mag-e-expire ang mga ito.",
