  "beginnerZone.rule.other.item3": "3. Ika-calculate gamit ang real-time exchange rates ang USD values ng deposits at trades sa duration ng event.",
  "beginnerZone.rule.other.item4": "4. Nakalaan sa {brandName} ang karapatang i-disqualify at i-revoke ang mga reward ng sinumang participant na napatunayang nakikisali sa mga mapanlinlang o ilegal na aktibidad.",
