  "c24utE9SJV6HKKaoe7aAtG": "Ano ang Mangyayari sa Aking Existing na ETH Holdings Pagkatapos ng Ethereum 2.0?",
  "c2eecc41a3634000a195": "Mga Centralized na Security Log",
  "c44a920dda8d4000afd9": "Isolation ng Data",
  "c4ff7e389fba4000ac35": "Emergency Response para sa mga Security Incident",
  "c5M7mDtTAust6kbEVq58PR": "Ina-allow ka ng coupon na ito na ma-experience ang mga VIP benefit at nagre-require ng manual activation.",
  "c6fb367612f54000aceb": "Unified na Management ng Domain",
  "c7dHuFehot2z56KESnyDfT": "Tier 1",
  "c9PPUBFA7Uwf5bafjZsxzT": "Deposit Method",
  "cAKYcShS2acZSPFwtC6rHQ": "2. Coin/Token Ticker",
  "cAma7RLEfixwbSc7RD4rvf": "Ang Bitcoin Halving ay isang naka-schedule na event na nagaganap nang humigit-kumulang bawat apat na taon, o pagkatapos ma-mine ang 210,000 blocks.",
  "cBtMERERqR8AmduwsiF8fq": "Isang recap ng mga key milestone sa path ng Ethereum patungo sa ETH 2.0, kasama ang Shanghai upgrade at kung ano ang hatid ng Danksharding.",
  "cC4zDEvB4JdsTjNEEJrB37": "Sa aling oras sini-shift ng Auto Earn ang aking funds?",
  "cFpjnxjDzGSx9FPwaMn253": "Nag-fail",
  "cGUDD25TQirfN9LZUTjkUu": "Unawain ang Management ng Private Key",
  "cK3356F74q5r1qrynPVYtj": "Nasagot nang Tama: <span class={className}>{text}</span>",
  "cLfojvQLgkQL2PDKBRAkwa": "Ang Bitcoin halving, na nagre-reduce sa miner rewards nang 50% sa bawat apat na taon, ay inaasahang magaganap ulit sa Abril 2024. Alamin kung paano ka puwedeng mag-trade at mag-profit mula sa pivotal event na ito sa {brandName}.",
  "cLzWHKXf4KRvaf8d978YE1": "Settlement Price",
  "cMTCR9nE5zwdWKkM7RrS3r": "Bearish",
  "cNeq632n1YNYLyKu1baEcw": "Ang pagpili sa tamang mining pool ay depende sa mga factor tulad ng cryptocurrency na mina-mine mo, mga preference sa hardware, mga payout method, at pool size. Maaaring magkaroon ng malaking epekto sa iyong earnings at overall na mining experience ang pagpili mo ng mining pool. Narito ang comprehensive na gabay kung paano i-select ang pinakamahusay na mining pool:",
  "cPamiqcY7EP8DZdAgvWYh2": "Price ng Cycle High",
  "cQMoH2cnJJBsQK4t3DoqH5": "Mag-sign Up para sa Gifts",
  "cRN8dqRBPPQTsRsXAxHVCy": "<span>I-diversify ang Iyong Portfolio:</span> Iwasang i-invest ang lahat ng funds sa pag-copying ng iisang trader. Mag-diversify sa iba-ibang trader, market, at trading style para ma-spread ang risk.",
  "cSkhMytfk9TJsiunSzqjFQ": "(1) Sa mga {brandName} email o on-site notification.",
  "cTqCKJWMgZatbJz6nNJiG8": "Total Debt",
  "cUcTs3UQjNCKViLLG1ReFE": "Pagkatapos ng The Merge, ang sumunod na significant na milestone ng Ethereum ay ang <a href='{url}' target='_blank'>Shanghai/Capella upgrade</a> noong Abril 2023. Ang upgrade na ito ay lubos na nagpahusay sa mga capability ng network nito, lalo na ang ability na mag-withdraw ng staked ETH. Minarkahan ng function na ito ang isang key step para gawing mas accessible ang Ethereum staking sa mas malawak na crypto community.",
  "cUhzWF2wWog7MYqXRWwSTv": "Export ng Spot Trading, Margin Trading, Futures Trading, at Convert orders lang ang supported ng mga sub-account.",
  "cWEVRDeZQNd55sy1RGC9aM": "Nag-fail ang auto-compound.",
  "cWihMsQrub1isit5KGf9mw": "Snowball",
  "cWseVzhsJAitVRpvWLyN5A": "Mag-withdraw sa",
  "cXp6c5hibRRsaTy7YqH1pG": "Wallet Address",
  "cXwjyNsuyzMAcmqaQPewWf": "6. Third-party code security review o audit report na issued ng isang established na security audit firm para sa iyong token/product/protocol",
  "cYPxCcdTiCQkuZg216uNRS": "Puwedeng mag-connect ang mga Web3 wallet sa iba't ibang blockchain network. Nagbibigay-daan ito para makapag-manage ka ng iba-ibang type ng cryptocurrencies, dahil ang bawat blockchain ay may sariling set ng rules at supported na assets.",
  "cYT8Z7NhzFg7DZmWWNHa29": "Sine-set ng staking protocol ang redemption period. Ang bawat cryptocurrency ay may sariling waiting period para sa pag-unstake ng mga asset. Walang maa-accrue na reward o yield sa duration na ito.",
  "ca07c31afdf34000a6b0": "Mga Firewall",
  "cancel": "I-cancel",
  "caqRmxF3vbrsnNp2wHQoB3": "Hanggang <span class='highlight'>{num} {currency}</span> sa Rewards para sa Bagong Users!",
  "cb13a680d3394000ad3c": "Pag-manage ng Whitelisted IP ng API",
  "cbEmWHKoEsh65U2FQhGwSY": "Iro-roll out sa mga phase ang upgrade. Makakatiyak ka na hindi maaapektuhan ang lahat ng asset at activity sa duration ng prosesong ito. Para sa higit pang detalye, pakitingnan ang mga nauugnay na announcement.",
  "cbgXeMERsW7TDBKUKrTJSX": "Mga simpleng strategy sa pag-earn",
  "cc2484732df34000a0fd": "Unified na Management ng Egress",
  "ccE83sgmVr2hGbjUESpUai": "Quiz: Mga Risk sa Leveraged Token Trading",
  "ccvs6VV8HT1isa4d7K2RGs": "Ang copy trading sa cryptocurrency ay isang strategy kung saan automatic na nire-replicate ng mga investor ang mga trade ng mga seasoned na trader. Nagbibigay-daan ito sa mga individual na mag-benefit mula sa expertise ng mga veteran nang hindi nangangailangan ng in-depth na <a href='{basiclurl}' target='_blank'>fundamental</a> o <a href='{url}' target='_blank'>market sentiment</a> analysis. Maaaring mas appealing sa mga bagong investor ang copy trading, dahil nag-aalok ito sa kanila ng paraan para i-navigate ang complex world ng <a href='{tradeurl}' target='_blank'>cryptocurrency trading</a> sa pamamagitan ng pag-leverage sa mga insight at approach ng mga professional na trader.",
  "cd347bae69ff4000a260": "Gumagamit ang {brandName} ng mga tool para i-monitor at i-manage ang mga hardware at software asset, kaya napipigilan ang hindi authorized na paggamit at theft. Ang mga audit log ng lahat ng critical operation ay nire-record at mino-monitor para ma-facilitate ang pag-trace at analysis kapag may mga security incident. Nagka-conduct din ang {brandName} ng mga regular audit para i-evaluate at i-improve ang mga security measure.",
  "cd7RaGbqmhhDwqQNqLRkWL": "I-download ang {brandName} app para simulan ang crypto journey mo, at makatanggap ng mga reward para sa bagong user!",
  "ceFhMxD1mcZH9Et9SdM4Gk": "Nasa mga kamay mo ang lahat, at nangangailangan ng personal na risk assessment at management.",
  "ceQEke9nGJG5xSpEfAfUwY": "Na-submit na ang request. Ino-notify ka kapag na-generate na ang iyong file. Kapag tapos na, maaari mo itong i-download sa Mga Recent na Export o History ng Export.",
