  "creator.fifth.step1.sub": "Tignan ang listahan ng mga paksa para sa kasalukuyang buwan at piliin ang mga nasa interes mo. Siguruhing nabasa ang mga tuntunin at kinakailangan para sa napili mong paksa bago ito gawin.",
  "creator.fifth.step1.title": "Piliin ang iyong mga paksa",
  "creator.fifth.step2.sub1": "Maaari kang gumawa ng content sa kahit anong porma, kasama na ngunit hindi limitado sa mga video, artikulo, infographics, larawan, at podcast. Kung ikaw ay may iba pang kawili-wiling ideya, ipaalam ito sa amin.",
  "creator.fifth.step2.sub2": "Siguruhing nasuri ang mga tuntunin at kinakailangan para sa napili mong paksa bago ka magsimula. Siguruhing nakita mo ang mga <span>tip</span> upang mapaigi ang iyong content.",
  "creator.fifth.step2.title": "Gumawa ng content",
