  "creator.fifth.step3.title": "Ilathala at ibahagi ang iyong content",
  "creator.fifth.step4.sub1": "Kapag natapos mo na ang Ika-3 Hakbang, isumite ang iyong content sa pamamagitan ng pagpuno ng detalye sa papel ng pagsumite.",
  "creator.fifth.step4.sub2": "Siguruhing nakumpleto ang bawat hakbang at isumitie ang iyong gawa bago ang huling araw ng bawat buwan. Ang hindi pagsunod ay makakaapekto sa pagkuha mo ng gantimpala.",
