  "creator.fourth.title": "Mga Hamon na Content",
  "creator.ninth.item1.sub": "Ang bawat creator ay maaaring makakuha ng libreng gantimpalang Bitcoin na puwedeng umabot para sa 3 pirasong content bawat wika.",
  "creator.ninth.item1.title": "Mga Reward",
  "creator.ninth.item2.sub": "Ang content ay dapat maisumite sa huling araw ng bawat buwan upang makasali para sa mga gantimpala.",
  "creator.ninth.item2.title": "Huling Araw ng Pagsumite",
  "creator.ninth.item3.sub": "Nakalaan sa {brandName} ang lahat ng karapatan sa huling interpretasyon ng mga pamantayan ng pagsusuri ng content.",
