  "creator.ninth.item4.sub": "Nakalaan sa {brandName} ang karapatang i-update, baguhin, at ilathala ang anumang sinumiteng content sa programang ito nang wlang paunang abiso.",
  "creator.ninth.item4.title": "Nailathalang Content",
  "creator.ninth.item5.sub": "Anumang na-plagiarize na content o panloloko sa kahit anong paraan ay magdidiskwalipika sa kalahok sa programang ito.",
  "creator.ninth.item5.title": "Plagiarism",
  "creator.ninth.item6.sub": "Sa paglahok sa programang ito, sumasang-ayon ka sa paglipat ng mga copyright ng iyong ginawa sa {brandName}. Nakalaan sa {brandName} ang lahat ng karapatan na baguhin ang mga tuntunin ng programang ito.",
  "creator.ninth.item6.title": "Mga Pagbabago sa Rule",
  "creator.ninth.title": "Terms at Conditions",
  "creator.second.btn": "I-submit ang Content",
  "creator.second.sub": "Naghahanap ang {brandName} ng mga malikhaing content creator upang makagawa ng de-kalidad na content. Ang mga nangungunang creator ay maaaring kumita ng hanggang $2,750 na halaga ng BTC kada buwan. Umpisahang pagkakitaan ang iyong pagkamalikhain NGAYON!",
  "creator.second.title": "Gawing Bitcoin ang iyong pagkamalikhain",
  "creator.seventh.item1.sub": "Sinumang mahilig sa crypto at sa paggawa ng content ay puwedeng sumali sa programa at makakuha ng libreng gantimpalang Bitcoin para sa kanilang kontribusyon.",
  "creator.seventh.item1.title": "Sino ang maaaring sumali sa Programang Content Creator?",
  "creator.seventh.item2.sub": "Oo, maaari. Ang aming Programang Content Creator ay hiwalay sa mga programa sa pagrekomenda at pag-anib. Subalit hindi mo maaaring gamitin ang mga nakalipas mong gawa para sa ibang mga programa para dito.",
  "creator.seventh.item2.title": "Maaari ba akong sumali dito kahit ako ay kasali na sa Programa ng {brandName} para sa Rekomendasyon at Pag-anib?",
  "creator.seventh.item3.sub": "Ang iyong ginawa ay susuriin base sa mga elemento gaya ng kalidad, pagkamalikhain, at impluwensya. Para sa mga karagdagang detalye, tigan ang <span>mga tip sa paggawa ng content</span>.",
  "creator.seventh.item3.title": "Paano susuriin ang aking content?",
