  "creator.sixth.item1.title": "Bonus para sa Nangungunang Creator",
  "creator.sixth.item2.sub": "Ang mahuhusay na creator ay magkakaroon ng tsansang maipakita sa mga opisyal na social channel ng {brandName}.",
  "creator.sixth.item2.title": "Mga Tampok na Rekomendasyon",
  "creator.sixth.item3.sub": "Ang mahuhusay na creator ay magkakaroon ng tsansang maging sertipikadong creator at maging pangmatagalang taga-ambag sa balitang {brandName} at mga blog.",
  "creator.sixth.item3.title": "{brandName} Certified Creator",
  "creator.sixth.title": "Karagdagang mga Bonus para sa mga Creator",
  "creator.third.li1": "Ang programa ay maglalatag ng kaganapan kada buwan na may magkakaibang paksa na pagpipilian ng mga creator. Ang mga creator ay maaaring pumili ng mga paksang interesado sila at ibigay ang kanilang content sa {brandName}. Bawat pirasong content na mapipili ng {brandName} ay tatanggap ng $500 na gantimpalang Bitcoin.",
