  "etf.action.subscribe": "Mag-subscribe",
  "etf.action.toTrade": "Mag-trade",
  "etf.answer.five.content1": "i. Bayarin sa Pangangakal: Ito ay sisingilin kapag bumibili/nagbebenta ng mga naka-leverage na token sa spot market. Ang antas ng bayarin ay kapareho nang sa spot trading.",
  "etf.answer.five.content2": "ii. Bayarin sa suskrisyon: Ito ay sisingilin kapag nagsususkribi ng mga naka-leverage na token. Sa kasalukuyan, ito ay {feeRate}% sa bawat pagsuskribi.",
  "etf.answer.five.content3": "iii. Bayarin sa suskrisyon: Ito ay sisingilin kapag tumubos ng mga naka-leverage na token.Sa kasalukuyan, ito ay {feeRate}% sa bawat pagtubos.",
  "etf.answer.five.content4": "iv. Bayarin sa pamamahala: {managementFees}% ay sisingilin tuwing 07:45 (UTC+8) bawat araw. Ang bayarin ay isasama sa netong halaga ng pag-aari ng mga naka-leverage na token at hindi makakaapekto sa iyong mga pinanghahawakan. Patuloy kang sisingilin sa pamamahala ng sistema, samakatuwid mangyaring maging maingat sa matagalang paghahawak ng mga naka-leverage na token.",
  "etf.answer.five.tilte": "Ang mga sumusunod ay ang mga bayaring hihingin mula sa mga Naka-leverage na Token ng {brandName}:",
  "etf.answer.one": "Ang mga Naka-leverage na Token ay mga pag-aaring puwedeng i-trade sa {brandName} spot market na gumagamit ng mga kinita sa pamamagitan ng long/short ng pinagbabatayang pag-aari. Halimbawa, kapag tumaas ang presyo ng BTC ng 1%, tataas ang BTC3L ng 3% samantalang ang BTC3S ay bababa ng 3%. Hindi gaya ng margin trade o futures trade, ang paghawak ng mga naka-leverage na token ay hindi nangangailangan ng mga kolateral o pagpapanatili ng margin, at walang panganib ng likidasyon. Gayunpaman, maaaring maging napakamasumpungin ng presyo mga naka-leverage na token, samakatuwid mangyaring maging masinop sa iyong pamumuhunan.",
  "etf.answer.six.content1": "i. Kumpara sa spot market, ang merkado ng mga naka-leverage na token ay may mas malaking panganib at walang katitiyakan. Ang mga naka-leverage na token ay maaaring magdala ng malakihang tubo o pagkalugi habang bukas ang kalakalan.",
  "etf.answer.six.content2": "ii. Dahil sa mekanismo ng pagbalanse muli at mga bayarin sa pamamahala, lalaki ang mga bayarin habang tumatagal ang paghawak ng mga naka-leverage na token.Samakatuwid, mangyaring maging maingat sa matagalang paghahawak ng mga naka-leverage na token.",
  "etf.answer.step1.content": "Maaari mong i-trade ang mga naka-leverage na token sa spot market ng {brandName}. Magpunta sa pahina ng mga naka-leverage na token at piliin ang nais mo, pindutin ang â€œI-trade â€ upang bumili o magbenta.",
  "etf.answer.step1.title": "i. {brandName} Spot market (rekomendado)",
  "etf.answer.step2.content": "Ipo-proseso ng {brandName} ang mga hiling sa pagsuskribi at pagtubos sa {unifiedSubmissionTimePoints} bawat araw. Ang mga presyo ng suskrisyon/pagtubos ay ayon sa resulta ng pagsasagawa, kaya hindi tiyak ang oras at presyo nito. Mangyaring maging maingat sa iyong pangangalakal. ",
  "etf.answer.step2.title": "ii. Suskrisyon/Pagtubos",
  "etf.answer.three": "Dahil sa mekanismo ng muling pagbabalanse, maganda ang mga Naka-leverage na Token ng {brandName} para sa mga isang-panig na pagkilos sa merkado samantalang hindi ito naaangkop para sa mga merkadong nagbabago. Kapag may mabilisang pagbabago, maaaring magkaroon ng malakihang pagkalugi habang bukas ang kalakalan, samakatuwid ibayong pag-iingat dapat sa maumuhunan.",
  "etf.answer.two": "Ang bawat Naka-leverage na Token ng {brandName} ay talagang isang bahagi ng naka-leverage na pondo. Sisiguruhin ng tagapamahala ng pondo na ang balik nito ay nakabatay sa partikular na pamantayan ng pinagbabatayang pag-aari at makakakuha dito ng tubo ang mga mangangalakal. Kapag ang pabagu-bagong sa kabila ay lumagpas sa entrada, maglalabas ng mekanismo ng muling pagbalanse ang sistema upang umiwas sa mga panganib, na sisiguro  sa pagkontrol ng lugi sa neto.",
  "etf.apply.alert": "<div>Nagaganap ng {unifiedSubmissionTimePoints} ang araw-araw na pagproseso. Nakabatay sa huling nakumpletong trade ang subscription at redemption price. </div> <div>Para mabawasan ang anumang risk o uncertainty, inirerekomenda namin ang paggamit ng spot trading.</div> <div class='tip'>Paki-note: Kapag nagsu-subscribe o nagre-redeem, ang iyong mga asset ay palaging iki-credit sa susunod na naka-schedule na processing time.</div>",
