  "aboutus.roadmap.2024.q3": "<p>Nagse-celebrate ng 7 taon ang {brandName}: \"7rust {brandName}, Own Your Future\"</p><p>In-introduce na ng {brandName} Futures ang <b>Cross Margin</b> na nag-e-enhance ng capital efficiency</p><p><b>Auto-Earn</b>: Isang feature para madaling i-subscribe ang idle funds sa Flexible Savings para sa stable na returns</p><p><b>Smart Earn</b>: Isang tool ng {brandName} Earn na nag-aalok ng mga iniangkop na recommendation batay sa mga preference at risk level</p><p><b>Mga Upgrade sa Trading Bot</b>: Ni-revamp na UI at mga bagong trading bot mode, na nagfi-feature ng 12 automated strategies para sa magkakaibang market condition</p><p></p>",
  "aboutus.roadmap.2024.q4": "<p>Ni-launch na ng {brandName} ang advanced <b>Options Trading</b> na nag-e-expand ng mga trading strategy at risk management tool</p><p>Ni-launch na ng {brandName} ang <b>Futures Perks</b>, isang dedicated na interface na may mga exclusive na promo para sa mga trader ng futures</p><p>Ni-release na ng {brandName} ang <b>Futures Copy Trading</b> na nag-e-enable sa real-time na pag-mirror ng strategy sa pamamagitan ng pag-integrate ng mga trade ng lead trader</p><p><b>News Flash</b>: Isang AI-powered news feed para sa mas matatalinong market insight</p><p><b>{brandName} Research</b>: Isang bagong resource hub para sa mga industry analysis at project report</p><p><b>{brandName} Learn and Earn</b>: Isang interactive na paraan para mag-earn ng libreng crypto sa pamamagitan ng pag-learn</p>",
